import React from 'react';
import './NavBar.css';



export default class NavBar extends React.Component {

  render() {
    const {whenClicked, whenScrolled} = this.props;

    return (<div className="navbar-container"
            style={{
            width: `${window.innerWidth}px`,
            height: `50px`
            }}>
              <button class="new-array-button" onClick={whenClicked}>New Array</button>
              <input
              id="changeSize"
              type="range"
              min="10"
              max="300"
              onChange={whenScrolled}
              />
            </div>)
  };


};
